@tbodin: When Win-Win gets released, of course. By the way, welcome and thanks.

@tylr: I just peeked in the swarm and seven peers have more than one and a half data volume  - what means IF all wants to finish - all must put DL and UL speeds at 1:1 ratio (eg. 20kB/s DL - 20 kB/s UL) and EXCHANGE the bytes already present. ALL must do this, if one wants to suck from others and give shit to fellow peers - ALL peers would never finish. 

Unfortunately, people do know how to "leech" but have no clue what "sharing" means.
